import FaqCss from "./faq.module.css";
import React from "react";

function Faqs() {
  return (
    <>
      <div className={FaqCss.container3}>
        <p className={FaqCss.faq}>Frequently Asked Questions</p>
        <div className= {FaqCss.main_box}>
            <div className = {FaqCss.small_box}>What is Netflix?
            <p>hhhhhhhhhhhhh</p>
            </div>
            <div className = {FaqCss.small_box}>How much does Netflix cost?</div>
            <div className = {FaqCss.small_box}>Where can I watch?</div>
            <div className = {FaqCss.small_box}>How do I cancel?</div>
            <div className = {FaqCss.small_box}>What can I watch on Netflix?</div>
            <div className = {FaqCss.small_box}>Is Netflix good for kids?</div>
        </div>
      </div>
    </>
  );
}

export default Faqs;
